import React from "react";
class CreateGame extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            gamesize: 0,
            players: [],
        }
    }


    handleSubmit(e){
        e.preventDefault();
        alert("You clicked submit. Value was: ");
    }


    render() {
        return (
            <div>
                <form onSubmit={this.handleSubmit}>
                    <button type="submit">Create game</button>
                </form>
            </div>
        )
    }
}

export default CreateGame;
